import React from 'react';

const weekDayName = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];

function ForecastWeather({ resultData }) {
  const dayInAWeek = new Date().getDay;
  weekDayName.slice(dayInAWeek, weekDayName.length).concat(weekDayName.slice(0, dayInAWeek));
  console.log(resultData)

  return (
    <div className="componentsBoxLayout">
      <div>{resultData.list.splice(0, 7).map((item, index) => (
        <div key={index}>
          <div>
            <img alt="Weather Icon" src={`icons/${item.weather[0].icon}.png`} />
          </div>
        </div>
      ))}</div>
    </div>
  )
}

export default ForecastWeather;
